GRP® Tour du Méjean-GR®6a - Portions de la commune de Saint-Pierre-des-Tripiers

Le bivouac est interdit dans le cœur du Parc national des Cévennes considérant qu’il peut entraîner des troubles à la tranquillité des lieux et de la faune sauvage, des risques d'incendie ainsi que des nuisances visuelles.

Néanmoins, il est autorisé le long des itinéraires balisés GR et GRP, à l’exception de quelques tronçons délimités sur la carte et selon les conditions cumulatives suivantes :

- pour les randonneurs non motorisés ;
- dans une tente légère ne permettant pas la station debout ou sans tente;
- pour une seule nuit d'affilée ;
- entre 19h le soir et 9h le matin ;
- à 50 m maximum de chaque côté de l'itinéraire de grande randonnée.

